import React, { useState } from "react";
import { Button, Grid } from "@mui/material";

export const Home = () => {
  const [data, setData] = useState(0);
  return (
    <Grid container spacing={2}>
      <Grid item xs={12}>
        <h1>Home </h1>
      </Grid>
      <Grid item xs={4}>
        <Button
          onClick={() => setData(data + 1)}
          variant="contained"
          color="success"
          fullWidth
        >
          Increment
        </Button>
      </Grid>
      <Grid item xs={4}>
        {data}
      </Grid>
      <Grid item xs={4}>
        <Button variant="contained" fullWidth>
          Decrement
        </Button>
      </Grid>
    </Grid>
  );
};
